import React, {Component} from 'react';
import ReactDOM from 'react-dom';

class Reactdom extends Component{
    
    myfun(){
         var container=document.getElementById('myid');
         var MyElem=<h2>This is container and elenent it's render ReactDOMe.</h2>
         var callback=function(){
             alert('i am call back');
         }

         ReactDOM.render(MyElem, container, callback);
    }
    
    render(){
        return (
        <div>
            <button onClick={this.myfun}>cheng</button>
            <h2 id="myid">my name is ismail</h2>
        </div>
        );
    }
}
export default Reactdom;

